    false,nt"url": null,nt"notes": "This Furbearer Management Plan for the
    Necedah National Wildlife Refuge is one of several step-down plans identified in
    the Refugeu2019s Comprehensive Conservation Plan and provides a revision of the
    1988 Refuge Trapping Plan. At that time u201cfur managementu201d referred specifically
    to trapping programs, including assessment of trapping desirability and relationship
    of trapping to other refuge objectives. u201cFurbearer managementu201d has since
    been adopted as a term for the more inclusive goal of management of populations,
    including knowledge of size and distribution and management by methods in addition
    to trapping. However, for practical purposes, trapping of furbearing animals, i.e.,
    predatory mammals and aquatic rodents with pelts of commercial value, continues
    to be the primary emphasis of the plan. The current trapping program in 2015, evaluated
    annually, is primarily a public use program.",nt"license_title": "License
